import DashboardHeader from "../components/dashboard/dashboardHeader"

export default function DashboardPage() {
    return (
        <div className="h-screen w-screen bg-[#fbfbfb]">
            <header>
                <div className="max-w-[90%] bg-[#fefefe] shadow rounded-lg mt-4 w-[90%] mx-auto py-6 px-4 sm:px-6 lg:px-8">
                    <h1 className="text-3xl font-bold font-display text-gray-900">Dashboard</h1>
                </div>
            </header>
        </div>
    )
}
